import React from 'react';

import styles from './Dashboard.module.css';
export const SidebarItem = ({ icon, label, isActive }) => {
  return (
    <div className={`${styles.sidebarItem} ${isActive ? styles.sidebarItemActive : ''}`}>
      <img loading="lazy" src={icon} alt="" className={styles.sidebarIcon} />
      <div className={styles.sidebarLabel}>{label}</div>
    </div>
  );
};
